    "2016-10-03T21:23:07.797441",nt"name": "pacific-islands-climate-change-virtual-librarya9dec",nt"isopen":
    false,nt"url": null,nt"notes": "The Virtual Library provides access to
    web based climate variability and climate change information and tools relevant
    to the Pacific Islands including case studies, guidebooks, and methodologies for
    assessing vulnerabilities. Decision makers and managers developing adaptation plans
    or incorporating the implications of climate into planning and decision making for
    water resources, conservation, land use planning, hazard management and other activities
    will find the resources of value. The Forum fosters communication among regional
    decision makers and agencies and organizations producing climate change information
    and resources to allow collaboration on the science and solutions to adapt to climate
    change. The site was originally developed for coastal decision makers in Samoa and
    American Samoa; however decision makers throughout the Pacific Islands region will
    find this site of value.",nt"license_title": null,nt"extras": [{ntt"key":
